has 'day_period_data' => (
	traits		=> ['Code'],
	is			=> 'ro',
	isa			=> 'CodeRef',
	init_arg	=> undef,
	handles		=> { call => 'execute_method' },
	default		=> sub { sub {
		# Time in hhmm format
		my ($self, $type, $time) = @_;
		SWITCH:
		for ($type) {
			if ($_ eq 'generic') {
				return 'night' if $time >= 2200
					&& $time < 200;
				return 'lateMorning' if $time >= 1000
					&& $time < 1400;
				return 'morning' if $time >= 600
					&& $time < 1000;
				return 'afternoon' if $time >= 1400
					&& $time < 1800;
				return 'evening' if $time >= 1800
					&& $time < 2200;
				return 'earlyMorning' if $time >= 200
					&& $time < 600;
			last SWITCH;
			}
			if ($_ eq 'gregorian') {
				return 'night' if $time >= 2200
					&& $time < 200;
				return 'lateMorning' if $time >= 1000
					&& $time < 1400;
				return 'morning' if $time >= 600
					&& $time < 1000;
				return 'afternoon' if $time >= 1400
					&& $time < 1800;
				return 'evening' if $time >= 1800
					&& $time < 2200;
				return 'earlyMorning' if $time >= 200
					&& $time < 600;
			last SWITCH;
			}
			if ($_ eq 'chinese') {
				return 'night' if $time >= 2200
					&& $time < 200;
				return 'lateMorning' if $time >= 1000
					&& $time < 1400;
				return 'morning' if $time >= 600
					&& $time < 1000;
				return 'afternoon' if $time >= 1400
					&& $time < 1800;
				return 'evening' if $time >= 1800
					&& $time < 2200;
				return 'earlyMorning' if $time >= 200
					&& $time < 600;
			last SWITCH;
			}
		}
	} },
);

